 import React from "react"
 import Contact from "./contact"
 import About from "./about"

 import "./index.css"
import { Redirect } from "react-router-dom"


 const App = ()=>{

    return (
        <>


          <Route exact path="/" component={About} />

          <Route path="/cnt" component={Contact} />

          <Redirect to="/" />


        </>
    )

    }

 export default App;
